$.nette.ext("ublaboo-spinners",{before:function(e,i){var t,a,r;if(i.nette){if(t=i.nette.el,r=$('<div class="ublaboo-spinner ublaboo-spinner-small"><i></i><i></i><i></i><i></i></div>'),t.is('.datagrid [name="group_action[submit]"]'))return t.after(r);if(t.is(".datagrid a")&&t.data("toggle-detail")){if(a=i.nette.el.attr("data-toggle-detail"),!$(".item-detail-"+a).hasClass("loaded"))return t.addClass("ublaboo-spinner-icon")}else{if(t.is(".datagrid .col-pagination a"))return t.closest(".row-grid-bottom").find(".col-per-page").prepend(r);if(t.is(".datagrid .datagrid-per-page-submit"))return t.closest(".row-grid-bottom").find(".col-per-page").prepend(r);if(t.is(".datagrid .reset-filter"))return t.closest(".row-grid-bottom").find(".col-per-page").prepend(r)}}},complete:function(){return $(".ublaboo-spinner").remove(),$(".ublaboo-spinner-icon").removeClass("ublaboo-spinner-icon")}});